I'd like to build out a GraphQL API that returns the albums with songs by Guided By Voices . They have such an extensive catalog, that'd it'd be fun to build out a GUI to browse them. query albumsWithSongs { albums { title year coverUrl songs { trackNo title } }
} Which would return something like: { "data": { "albumsWithSongs": { "albums": [ { "title": "Bee Thousand", "year": 1994, "coverUrl": "https://example.com/bee-thousand.jpg", "songs": [ { "trackNo": 1, "title": "Hardcore UFO's" }, { "trackNo": 2, "title": "Buzzards and Dreadful Crows" } ] }, { "title": "Alien Lanes", "year": 1995, "coverUrl": "https://example.com/alien-lanes.jpg", "songs": [ { "trackNo": 1, "title": "A Salty Salute" }, { "trackNo": 2, "title": "Evil Speakers" } ] } ] } }
} I could imagine there also being support for: an argument that returns the albums released in a given year searching by album name and song name and returning results sorting results alphabetically or by release year I've been interested in Rust and TypeScript lately, so I'd probably use one of those for building out this API.

